const Planet = () => {
    return (
        <Fragment>
        <h4>Mercúrio</h4>
        <p>Loren Ipsium...Loren Ipsium...Loren Ipsium...Loren Ipsium...Loren Ipsium...</p>
        <img src="https://pt.wikipedia.org/wiki/Merc%C3%BArio_(planeta)#/media/Ficheiro:Mercury_in_color_-_Prockter07-edit1.jpg"></img>
        </Fragment>
    )}

    export default Planet;
